import requests

url = "https://cnbc.p.rapidapi.com/symbols/translate"
querystring = {"symbol": symbol}

headers = {
    "X-RapidAPI-Key": "SIGN-UP-FOR-KEY",
    "X-RapidAPI-Host": "cnbc.p.rapidapi.com"
}

response = requests.get(url, headers=headers, params=querystring)

print(response.json())

